import React from 'react'
import {fetch as fetchPolyfill} from 'whatwg-fetch'


/**
 * 我们的基本的工具
 */

// parseJSON=function(response){
//     return response.json()
// }

export function FetchDoGet(url,data,callback){
    window.fetch(url,{
        method:"GET",
        body:data
    }).then(function(response){
        return response.json()
    }).then(function(json){
       console.log(json)
    });
}
